import React from 'React'

const axios = require('axios')

function User() {
    var arr = null
    var getUser = () => {
        axios({
            method: 'get',
            url: 'http://localhost:5000/api/dummy',
        })
        .catch( err => console.log(err) )
        .then( res => {
            arr = res.data
            console.log(res)
        })
    }

    return <>
    <button onClick = {getUser}>Show all users</button>
    <div>{arr}</div>
    </>
}

export default User
